import React from "react"

export const LoginPage = (props) => {
  return (
    <>
      <div className="LoginPage bg-gradient-to-br from-indigo-500 to-pink-300 min-h-screen">
        <div className="modal translate-y-1/2 h-96 w-1/2 bg-white grid m-auto">
          <button onClick={props.loggedInChange}>Login</button>
        </div>
      </div>
    </>
  )
}
